import "./VcanciesItem.css"
import {Link} from "react-router-dom";
import React from "react";

const VacanciesItem =({vacancies,setModalVacations})=> {
    return (
        <>
            <div className="angry-grid1">
                <div className='VacationsContainer' onClick={() => setModalVacations(true)}></div>
                <div id="item-01">{vacancies.name}</div>
                <div id="item-11">NEW</div>
                <div id="item-21">{vacancies.description}</div>
                <div id="item-31"></div>
                <div id="item-41">{vacancies.create_date}</div>
            </div>
        </>
    )
}

export default VacanciesItem
